import './App.css';

function HeaderSection() {
  return (
    <div className='m-16'>
      <div className='border-2 border-black'>
        <div className="text-5xl mx-64 mt-32 text-center fbask-reg">
          Skincare ahhh site.
        </div>
        <div className='fbask-ital text-3xl text-center '>
          By: Anirud Lappathi and others
        </div>
      </div>
      <div className='fbask-reg text-center'>
        Figure out your skin issues
      </div>
    </div>
  );
}

export default HeaderSection;
